import React from "react";
import Navbar from "../components/Navbar";
import "../styles/homepage.css"
function HomePage() {
    return (
        <div>
            <Navbar />
            <div className="Background">
                <h1>TreePeeps</h1>
                <button>Login</button>
                <button>Sign Up</button>
            </div>
        </div>
    )
}

export default HomePage;
